import React from 'react';

class Header extends React.Component {
    render() {
        return (
            <a href="?#">
                <div id="header">
                    <h1 className="noDecoration">pon&nbsp;suke人生リークBlog</h1>
                </div>
            </a>
        );
    }
}

export default Header;
